      "SERCODIGO":"GAC12_IDPIB12","SERNOME":"PIB mensal - \u00edndice dessaz. (1995 = 100)","SERCOMENTARIO":"Indicador mensal do n\u00edvel de atividade econ\u00f4mica. Utilizando-se o m\u00e9todo de desagrega\u00e7\u00e3o temporal de Denton (1971), estimou-se uma s\u00e9rie de \u00edndice de PIB mensal dessazonalizado com base num indicador mensal de atividade econ\u00f4mica, o \u00cdndice de Atividade Econ\u00f4mica (IBC-Br) dessazonalizado, do Banco Central do Brasil (BCB). Este foi utilizado para desagregar temporalmente a s\u00e9rie de dados originais dessazonalizados do PIB trimestral, divulgados pelo Sistema de Contas Nacionais (SCN), do Instituto Brasileiro de Geografia e Estat\u00edstica (IBGE), de forma que as m\u00e9dias trimestrais e anuais do \u00edndice de PIB mensal s\u00e3o iguais aos dados correspondentes do PIB original. Para maiores informa\u00e7\u00f5es: <a href=\"../doc/Nota T\u00e9cnica PIB mensal.pdf\">Nota T\u00e9cnica PIB mensal.</a>","SERATUALIZACAO":"2015-12-14T17:39:31.823-02:00","BASNOME":"Macroecon\u00f4mico","FNTSIGLA":"IPEA","FNTNOME":"Instituto de Pesquisa Econ\u00f4mica Aplicada (IPEA)","FNTURL":"www.ipea.gov.br","PERNOME":"Mensal","UNINOME":"-","MULNOME":null,"SERSTATUS":"A","TEMCODIGO":8,"PAICODIGO":"BRA","SERNUMERICA":true
