      "SERCODIGO":"SCN4_PIB4","SERNOME":"PIB - pre\u00e7os b\u00e1sicos - \u00edndice encadeado (m\u00e9dia 1995 = 100) - ref. 2000","SERCOMENTARIO":"Fonte: Para 1991-1994: Sistema de Contas Nacionais Trimestrais Refer\u00eancia 2000 (dados oriundos do banco Sidra). Obs.: Diferencia-se do PIB a pre\u00e7os de mercado pela exclus\u00e3o dos impostos sobre produtos. At\u00e9 1994, a soma dos valores adicionados nos tr\u00eas grandes setores (agropecu\u00e1ria, ind\u00fastria e servi\u00e7os) supera o total do PIB a pre\u00e7os b\u00e1sicos, que inclui tamb\u00e9m um setor fict\u00edcio com PIB negativo (pois n\u00e3o tem produ\u00e7\u00e3o, s\u00f3 custos intermedi\u00e1rios) denominado \"dummy financeiro\" ou \"imputa\u00e7\u00e3o de servi\u00e7os de intermedia\u00e7\u00e3o financeira\". Esse setor fict\u00edcio, com s\u00e9ries dispon\u00edveis no Ipeadata, corresponde a custos financeiros indiretamente medidos pelo IBGE e que podem ter incidido sobre qualquer um dos setores. No Ipeadata, as s\u00e9ries em % do PIB mant\u00eam os percentuais tal como publicados pelo IBGE e, por isso, os tr\u00eas grandes setores somam mais de 100% do PIB at\u00e9 1994.","SERATUALIZACAO":"2014-11-28T15:41:14.097-02:00","BASNOME":"Macroecon\u00f4mico","FNTSIGLA":"IBGE/SCN 2000 Trim.","FNTNOME":"Instituto Brasileiro de Geografia e Estat\u00edstica, Sistema de Contas Nacionais Trimestrais Refer\u00eancia 2000 (IBGE/SCN 2000 Trim.)","FNTURL":"www.ibge.gov.br","PERNOME":"Trimestral","UNINOME":"-","MULNOME":null,"SERSTATUS":"I","TEMCODIGO":8,"PAICODIGO":"BRA","SERNUMERICA":true
