      "SERCODIGO":"PIB","SERNOME":"PIB Municipal a pre\u00e7os constantes","SERCOMENTARIO":"Fontes: Para 1999-2007: Sistema de Contas Regionais Refer\u00eancia 2009. As estimativas do PIB a custo de fatores e a pre\u00e7os b\u00e1sicos \u00e9 igual \u00e0 soma dos setores: agropecu\u00e1ria, industria e servi\u00e7os.  Conceito utilizado antes de 1999: a custo de fatores.  A partir de 1999 o conceito do PIB utilizado \u00e9 o de pre\u00e7os de mercado, neste per\u00edodo deve ser acrescentado a dummy financeira e os impostos sobre produtos. <BR> Para os anos censit\u00e1rios de 1970 a 1996, elaborado pelo IPEA. Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T12:26:21.517-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
