      "SERCODIGO":"PIBAG","SERNOME":"PIB Municipal - agropecu\u00e1ria - valor adicionado - pre\u00e7os b\u00e1sicos","SERCOMENTARIO":"Fontes: Para 2002-2005: Sistema de Contas Regionais Refer\u00eancia 2002. Para 1999-2001: Antigo Sistema de Contas Regionais. Conceito utilizado a partir de 1999 a pre\u00e7os b\u00e1sicos. <BR> Para os anos censit\u00e1rios de 1970 a 1996, elabora\u00e7\u00e3o do IPEA pelo rateio do PIB agropecu\u00e1ria a custo de fatores, em n\u00edvel estadual do IBGE pela estimativa do valor adicionado na agropecu\u00e1ria dos munic\u00edpios do estado, calculado pela soma do valor da produ\u00e7\u00e3o e outras receitas menos as despesas de consumo intermedi\u00e1rio com base nos Censos dos respectivos anos.  F\u00f3rmula de c\u00e1lculo:  VA Agro = VP + OREC - CI; onde VA Agro = Valor Adicionado da Agropecu\u00e1ria; VP = Valor da Produ\u00e7\u00e3o; OREC = Outras Receitas do Estabelecimento; CI = Consumo Intermedi\u00e1rio.  Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T12:25:26.05-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
