      "SERCODIGO":"PIBAGE","SERNOME":"PIB Estadual - agropecu\u00e1ria - valor adicionado - pre\u00e7os b\u00e1sicos","SERCOMENTARIO":"Fontes: Para 2002-2006: Sistema de Contas Regionais Refer\u00eancia 2002.  Para 1985-2001: Antigo Sistema de Contas Regionais. Conceito utilizado a partir de 1985 a pre\u00e7os b\u00e1sicos.  <BR> Para os anos de 1970, 1975 e 1980, Produto Interno Bruto a custo de fatores elaborado pelo IBGE.  Para os anos de 1939, 1947 a 1969, Produto Interno L\u00edquido a custo de fatores elaborado pela FGV , neste periodo os dados referentes aos territ\u00f3rios de Rond\u00f4nia e Roraima e ao estado do Acre est\u00e3o incluidos no estado do Amazonas e o territ\u00f3rio do Amap\u00e1 est\u00e1 incluido no Par\u00e1.  <BR> As estimativas do PIB n\u00e3o s\u00e3o consistentes com o PIB por atividades. O problema se deve \u00e0 utiliza\u00e7\u00e3o de conceitos distintos. O PIB refere-se a pre\u00e7os de mercado e as atividades a pre\u00e7os b\u00e1sicos.","SERATUALIZACAO":"2013-09-12T16:17:24.653-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Anual","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
