      "SERCODIGO":"PIBAL","SERNOME":"PIB Municipal - servi\u00e7os - atividades imobili\u00e1rias e aluguel - valor adicionado - pre\u00e7os b\u00e1sicos","SERCOMENTARIO":"Fonte: Para os anos censit\u00e1rios de 1970 a 1996, elabora\u00e7\u00e3o do IPEA pelo rateio do PIB alugu\u00e9is a custo de fatores, em n\u00edvel estadual do IBGE pelo valor bruto da produ\u00e7\u00e3o de alugu\u00e9is estimado em n\u00edvel municipal pela soma do valor bruto da produ\u00e7\u00e3o de alugu\u00e9is residenciais e do valor bruto da produ\u00e7\u00e3o de alugu\u00e9is n\u00e3o residenciais. Para 1970 e 1980,  o valor do aluguel das edifica\u00e7\u00f5es \u00a0n\u00e3o residenciais, incluem  m\u00e1quinas, equipamentos e outros bens.  Para os anos intercensit\u00e1rios utiliza-se interpola\u00e7\u00e3o aritm\u00e9tica.  Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T11:59:20.01-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
