      "SERCODIGO":"PIBCO","SERNOME":"PIB Municipal - servi\u00e7os - com\u00e9rcio - valor adicionado - pre\u00e7os b\u00e1sicos","SERCOMENTARIO":"Fonte: Para os anos censit\u00e1rios de 1970 a 1996, elabora\u00e7\u00e3o do IPEA pelo rateio do PIB com\u00e9rcio a custo de fatores, em n\u00edvel estadual do IBGE pelas estimativas em n\u00edvel municipal do valor adicionado do com\u00e9rcio estimado pela soma valor das vendas e receitas de atividades suplementares menos compras de mercadorias, despesas gerais, despesas l\u00edquidas com energia el\u00e9trica, e varia\u00e7\u00e3o dos estoques a pre\u00e7os constantes.  F\u00f3rmula de c\u00e1lculo:  Valor Adicionado do Com\u00e9rcio = A+B-C-D-(E+F-G) +(I*(IGPjun75/IGPdec75) - H*(IGPjun75/IGPdec74)), sendo: A. Venda de Mercadorias; B. Receita de Atividades Suplementares; C. Compras de Mercadorias; D. Despesas Gerais; E. Energia El\u00e9trica Adquirida ; F.  Energia El\u00e9trica Recebida para Transforma\u00e7\u00e3o; G. Energia El\u00e9trica vendida ou Cedida; H. Estoque de Mercadorias em 12/74; I.  Estoque de Mercadorias em 12/75.  Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T11:59:20.01-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
