      "SERCODIGO":"PIBSE","SERNOME":"PIB Municipal - servi\u00e7os - valor adicionado - pre\u00e7os b\u00e1sicos","SERCOMENTARIO":"Fontes: Para 1999-2007: Sistema de Contas Regionais Refer\u00eancia 2009.  Conceito utilizado a partir de 1999 a pre\u00e7os b\u00e1sicos.  <BR> Para os anos censit\u00e1rios de 1970 a 1996, elaborado pelo IPEA.  As atividades deste setor compreendem: com\u00e9rcio, transporte e comunica\u00e7\u00e3o, intermedia\u00e7\u00e3o financeira, administra\u00e7\u00e3o p\u00fablica, alugu\u00e9is e outros servi\u00e7os.  Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T12:25:50.247-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
