      "SERCODIGO":"PIBSIU","SERNOME":"PIB Municipal - ind\u00fastria - servi\u00e7os de utilidade p\u00fablica","SERCOMENTARIO":"Fonte: Para os anos censit\u00e1rios de 1970 a 1996, elabora\u00e7\u00e3o do IPEA pelo rateio do PIB servi\u00e7os industriais de utilidade p\u00fablica a custo de fatores, em n\u00edvel nacional do IBGE para as atividades de produ\u00e7\u00e3o, transmiss\u00e3o e distribui\u00e7\u00e3o de energia el\u00e9trica e abastecimento de \u00e1gua pelas estimativas em n\u00edvel municipal da quantidade produzida e consumida de energia el\u00e9trica com base nos dados de Censos dos respectivos anos, bem como da localiza\u00e7\u00e3o municipal das hidroel\u00e9tricas. No per\u00edodo 1970/87,  a produ\u00e7\u00e3o, distribui\u00e7\u00e3o e consumo de energia el\u00e9trica foram respons\u00e1veis, em m\u00e9dia, por 85% do produto total do setor.  Para metodologia ver: <a href=\"../doc/PIB municipal.pdf \">Metodologia PIB Municipal 1970 a 1996</a> <BR> Para dados anteriores a 1999 as estimativas do PIB das atividades em n\u00edvel municipal n\u00e3o s\u00e3o consistentes com aquelas em n\u00edvel estadual e nacional. O problema se deve \u00e0 utiliza\u00e7\u00e3o de metodologias distintas .","SERATUALIZACAO":"2013-06-20T11:59:20.01-03:00","BASNOME":"Regional","FNTSIGLA":"IBGE","FNTNOME":"Instituto  Brasileiro de Geografia e Estat\u00edstica","FNTURL":"www.ibge.gov.br","PERNOME":"Quinquenal","UNINOME":"R$, a pre\u00e7os do ano 2000","MULNOME":"mil","SERSTATUS":null,"TEMCODIGO":81,"PAICODIGO":null,"SERNUMERICA":true
